import React from 'react';
import { FaEnvelope, FaPhone, FaMapMarkerAlt } from 'react-icons/fa';

const Contact = () => {
  const email = 'email@example.com';
  const phoneNumber = '+1 123 456 7890';
  const address = '인하대학교 하이테크센터 101호';

  return (
    <div className="contact-container">
      <h2>문의하기</h2>
      <p>궁금한 사항이 있으신가요? 언제든지 문의해주세요! 다양한 방법으로 연락이 가능합니다.</p>

      <div className="contact-method">
        <FaEnvelope />
        <p>Email: {email}</p>
      </div>

      <div className="contact-method">
        <FaPhone />
        <p>전화번호: {phoneNumber}</p>
      </div>

      <div className="contact-method">
        <FaMapMarkerAlt />
        <p>방문주소: {address}</p>
      </div>

      <h3>자주 묻는 질문 (FAQ)</h3>
      <ul>
        <li><strong>Q:</strong> 여행 일정을 어떻게 계획하나요?</li>
        <p><strong>A:</strong> 여행 일정을 계획하는 방법에 대한 자세한 정보는 [여행 일정 계획하기 가이드]를 참고해주세요.</p>

        <li><strong>Q:</strong> 플래너 제작에 대해 더 알고 싶어요. 어떻게 시작하나요?</li>
        <p><strong>A:</strong> 플래너 제작 가이드를 따라가며 쉽게 플래너를 만들어보세요. [플래너 제작 가이드]에서 자세한 내용을 확인할 수 있습니다.</p>

        <li><strong>Q:</strong> 여행 중에 도움이 필요한 경우 어떻게 연락하나요?</li>
        <p><strong>A:</strong> 여행 중에는 긴급 상황 또는 도움이 필요한 경우에도 언제든지 위의 연락처로 문의해주세요. 24시간 서비스를 제공하고 있습니다.</p>
      </ul>

      <p>프로젝트 관련된 모든 문의를 환영합니다. 더 나은 여행을 위해 언제든지 도움을 드리겠습니다!</p>
    </div>
  );
};

export default Contact;
